So, what can we do about data races? A simple approach is to use critical sections , a context where interrupts are disabled. By wrapping the access to COUNTER in main in a critical section, we can be sure the timer interrupt will not fire until we're finished incrementing COUNTER : static mut COUNTER: u32 = 0; #[entry]
fn main() -> ! { set_timer_1hz(); let mut last_state = false; loop { let state = read_signal_level(); if state && !last_state { last_state = state; // New critical section ensures synchronised access to COUNTER cortex_m::interrupt::free(|_| { unsafe { COUNTER += 1 }; }); } }
} #[interrupt]
fn timer() { unsafe { COUNTER = 0; }
} In this example we use cortex_m::interrupt::free , but other platforms will have similar mechanisms for executing code in a critical section. This is also the same as disabling interrupts, running some code, and then re-enabling interrupts. Note we didn't need to put a critical section inside the timer interrupt, for two reasons: Writing 0 to COUNTER can't be affected by a race since we don't read it It will never be interrupted by the main thread anyway If COUNTER was being shared by multiple interrupt handlers that might preempt each other, then each one might require a critical section as well. This solves our immediate problem, but we're still left writing a lot of unsafe code which we need to carefully reason about, and we might be using critical sections needlessly — which comes at a cost to overhead and interrupt latency and jitter. It's worth noting that while a critical section guarantees no interrupts will fire, it does not provide an exclusivity guarantee on multi-core systems! The other core could be happily accessing the same memory as your core, even without interrupts. You will need stronger synchronisation primitives if you are using multiple cores.

