Typically, libraries written in C or C++ will provide a header file defining all types and functions used in public interfaces. An example file may look like this: /* File: cool.h */
typedef struct CoolStruct { int x; int y;
} CoolStruct; void cool_function(int i, char c, CoolStruct* cs); When translated to Rust, this interface would look as such: /* File: cool_bindings.rs */
#[repr(C)]
pub struct CoolStruct { pub x: cty::c_int, pub y: cty::c_int,
} pub extern "C" fn cool_function( i: cty::c_int, c: cty::c_char, cs: *mut CoolStruct
); Let's take a look at this definition one piece at a time, to explain each of the parts. #[repr(C)]
pub struct CoolStruct { ... } By default, Rust does not guarantee order, padding, or the size of data included in a struct . In order to guarantee compatibility with C code, we include the #[repr(C)] attribute, which instructs the Rust compiler to always use the same rules C does for organizing data within a struct. pub x: cty::c_int,
pub y: cty::c_int, Due to the flexibility of how C or C++ defines an int or char , it is recommended to use primative data types defined in cty , which will map types from C to types in Rust pub extern "C" fn cool_function( ... ); This statement defines the signature of a function that uses the C ABI, called cool_function . By defining the signature without defining the body of the function, the definition of this function will need to be provided elsewhere, or linked into the final library or binary from a static library. i: cty::c_int, c: cty::c_char, cs: *mut CoolStruct Similar to our datatype above, we define the datatypes of the function arguments using C-compatible definitions. We also retain the same argument names, for clarity. We have one new type here, *mut CoolStruct . As C does not have a concept of Rust's references, which would look like this: &mut CoolStruct , we instead have a raw pointer. As dereferencing this pointer is unsafe , and the pointer may in fact be a null pointer, care must be taken to ensure the guarantees typical of Rust when interacting with C or C++ code.

